import './App.css';
import { useState } from 'react';
import React from 'react'




function App() {
  const [Weatherlist, SetWeatherlist] = useState([]);

  React.useEffect(() => {
    fetch('api.coincap.io/v2/assets')
       .then((response) =>{response.json();} )
       .then((data) => {
        console.log(data);
          SetWeatherlist(data);
       })
       .catch((err) => {
          console.log(err.message);
       });
 }, []);




  return (
    <div className="App">


     <ul>
     {Weatherlist.map((item) => <li>{item.id}</li>)}
     </ul>



    </div>
  );
}










export default App;
